import { fetchData } from "../../API";

export const Body = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    // for (let id = 1; id < 30; id++) {
    // }
    fetchData(data, setData);
  }, []);

  data && console.log(data);

  return (
    data &&
    data.map((entry) => (
      <div key={entry.title} className="bg-coffee-l">
        {entry.title} {entry.type}
      </div>
    ))
  );
};
